import React from 'react'
import Navbar from '../components/General/Navbar';
import Banner from '../components/General/Bannerbar';

const Historical = () => {
    return (

        <div
          style={{
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            height: '90vh'
          }}
        >
          <Navbar />
          <Banner />
          <h1>This will display Historical page</h1>
        </div>
      );
}

export default Historical
